namespace RonSijm.FluidHumidifier.Factories.Kendra;

public class InnerDataSourceDatabaseConfigurationFactory(Action<Humidifier.Kendra.DataSourceTypes.DatabaseConfiguration> factoryAction = null) : SubResourceFactory<Humidifier.Kendra.DataSourceTypes.DatabaseConfiguration>
{

    internal InnerDataSourceSqlConfigurationFactory SqlConfigurationFactory { get; set; }

    internal InnerDataSourceConnectionConfigurationFactory ConnectionConfigurationFactory { get; set; }

    internal InnerDataSourceColumnConfigurationFactory ColumnConfigurationFactory { get; set; }

    internal InnerDataSourceDataSourceVpcConfigurationFactory VpcConfigurationFactory { get; set; }

    internal InnerDataSourceAclConfigurationFactory AclConfigurationFactory { get; set; }

    protected override Humidifier.Kendra.DataSourceTypes.DatabaseConfiguration Create()
    {
        var databaseConfigurationResult = CreateDatabaseConfiguration();
        factoryAction?.Invoke(databaseConfigurationResult);

        return databaseConfigurationResult;
    }

    private Humidifier.Kendra.DataSourceTypes.DatabaseConfiguration CreateDatabaseConfiguration()
    {
        var databaseConfigurationResult = new Humidifier.Kendra.DataSourceTypes.DatabaseConfiguration();

        return databaseConfigurationResult;
    }
    public override void CreateChildren(Humidifier.Kendra.DataSourceTypes.DatabaseConfiguration result)
    {
        base.CreateChildren(result);

        result.SqlConfiguration ??= SqlConfigurationFactory?.Build();
        result.ConnectionConfiguration ??= ConnectionConfigurationFactory?.Build();
        result.ColumnConfiguration ??= ColumnConfigurationFactory?.Build();
        result.VpcConfiguration ??= VpcConfigurationFactory?.Build();
        result.AclConfiguration ??= AclConfigurationFactory?.Build();
    }

} // End Of Class

